import { BrowserRouter, Switch, Route } from 'react-router-dom';
import main from './components/main';
import './App.css';

function App() {
  return (
    <div className="App">
      <BrowserRouter>
        <Switch>
          <Route exact path='/' component={main}/>
        </Switch>
      </BrowserRouter>
    </div>
  );
}

export default App;
